import React from 'react';

const ItemCart = ({item}) => {
    return (
        <div>
            <tr>
            <td>{item.name}</td> 
            <td>{item.amount}</td> 
            <td>${item.price}</td>
            </tr>
        </div>
    );
}

export default ItemCart;
